`,s.jsx(l.h2,{children:"Introduction"}),`
`,s.jsx(l.p,{children:"Testing is an integral part of software development, providing developers with confidence when making additions, changes, or refactors to the codebase. As I've embarked on my journey to learn frontend development, I often found myself pondering what to test first—utility functions, query calls, components, form schemas, or pages. Typically, I start by testing utility functions, such as date or number formatting, mappers, and other pure functions. These are easy, cost-effective, and quick to test. Then, I proceed with integration tests for more complex scenarios, like data creation involving multiple components: input forms, form schemas, confirmation dialogs, and toast notifications. While integration testing is more challenging, costly, and time-consuming compared to unit testing, it provides immense confidence when introducing changes to the application."}),`
`,s.jsx(l.p,{children:"Over the past few months, I've been learning into integration testing for forms and several pages in my application using Jest and React Testing Library, but for learning purpose, I’ll try to use Vitest here since it's compatible with Jest. I've found this process enjoyable and worthwhile, so I'm documenting it for my own learning purposes."}),`
`,s.jsx(l.h2,{children:"Project Overview"}),`
`,s.jsx(l.p,{children:"For this tutorial, I'll show how to test a form that uses several types of components with client-side validation. I've used Vitest as a test runner, and mainly use native component and Radix UI for building this form, which affects what we need to mock and how to test the component."}),`
`,s.jsx(l.h2,{children:"Testing Criteria"}),`
`,s.jsx(l.p,{children:"When conducting integration tests, I've set some criteria to guide my approach:"}),`
`,s.jsxs(l.ul,{children:[`
`,s.jsx(l.li,{children:"Minimize the use of mocks: Reducing the reliance on mocks ensures that tests closely resemble user behavior."}),`
`,s.jsx(l.li,{children:"Mimic user behavior as closely as possible: The goal is to replicate real-world interactions with the application."}),`
`,s.jsx(l.li,{children:"Avoid testing implementation details: Instead of testing how things are implemented, focus on testing the functionality and behavior."}),`
`]}),`
`,s.jsx(l.h2,{children:"Setup"}),`
`,s.jsx(l.p,{children:"Before diving into integration testing, several configurations must be set up, depending on the components and libraries used in your forms or pages. This might involve:"}),`
`,s.jsxs(l.ul,{children:[`
