`,s.jsxs(l.p,{children:["Many component in Radix UI use ",s.jsx(l.code,{children:"useSize"})," hook that implement ",s.jsx(l.code,{children:"ResizeObserver"})," under the hood, thus it will give an error when we run test in JSDOM environment, it’s because JSDOM currently doesn’t implement ",s.jsx(l.code,{children:"ResizeObserver"}),". Therefore, we must add mock to emulate ",s.jsx(l.code,{children:"ResizeObserver"})," behavior."]}),`
`,s.jsx(l.pre,{children:s.jsx(l.code,{className:"language-tsx",children:`// Mock the ResizeObserver
